// import  React from "react";

import { useEffect } from "react";

import Footer from "../../components/footer/footer";
import "./style.css";
import { Navbartest } from "../../components/navbartest/navbartest";
// import './scripts.js';
import { CssBaseline, Grid } from "@material-ui/core";
import logo from "../../assets/img/COD_LOGOvs2.png";
import AOS from "aos";
import "aos/dist/aos.css";

// import React, { CSSProperties } from "react";

function Home_test(): JSX.Element {
  useEffect(() => {
    AOS.init({ duration: 3000 });
    AOS.refresh();
  }, []);
  return (
    <>
      {/* <!-- ======= Header ======= --> */}
      {/* <Header /> */}
      <CssBaseline />
      <Navbartest />
      <div className="bloco-externo">
        <Grid container spacing={2}>
          <Grid item xs={6} sm={6}>
            <Grid container spacing={4}></Grid>
            <Grid item xs={12} data-aos="fade-down">
              <div style={{ background: "#4d79ff" }}>
                <h1>CAMPUS</h1>
              </div>
            </Grid>
          </Grid>
          <Grid item xs={6} sm={6}>
            <img src={logo} className="animated" alt=""></img>
          </Grid>
        </Grid>
      </div>

      <Footer />
    </>
  );
}

export default Home_test;
